import React from "react";

import { Table,Row,Col} from "react-bootstrap";

import "./formCard.css";

import logo1 from "../../../Images/assets/LUSD.png";
import logo2 from "../../../Images/assets/Dai_Logo1.png";

const formCard = () => {
  return (
    <div className=" auction-card-container">
      <div className="auction-card-wrapper">
        <div className="card_module">
          <Row>
            <Col>
              <img className="img_css" src={logo2} alt="DAI"></img>
            </Col>
            <Col></Col>
            <Col className="left_col">0.00 DAI</Col>
          </Row>
          <Row>
            <Col>
              <img className="img_css" src={logo1} alt="LUSD"></img>
            </Col>
            <Col></Col>

            <Col className="left_col">0.00 LSD</Col>
          </Row>
          <Row className=" mt-5">
            <Col>Unlocked DAI:</Col>
            <Col></Col>
          </Row>
          <hr className="" />
          <hr className="" />
          <hr className="" />
          <hr className="" />
        </div>
      </div>
    </div>
  );
};  
export default formCard;
